import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // optional: add a custom CSS file if needed
import App from './App'; // we will create App.js next

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
